import React, { useState, useEffect } from "react";
import "../styles/Resources.css";

const initialResources = [
  {
    id: 1,
    category: "academic",
    title: "Library Services",
    description:
      "Access to extensive academic databases and research materials",
  },
  {
    id: 2,
    category: "financial",
    title: "Scholarship Database",
    description: "Comprehensive list of available scholarships and grants",
  },
  {
    id: 3,
    category: "career",
    title: "Resume Workshop",
    description: "Learn how to create a standout resume for job applications",
  },
  {
    id: 4,
    category: "health",
    title: "Counseling Services",
    description: "Free mental health support for all students",
  },
  {
    id: 5,
    category: "social",
    title: "Student Clubs Directory",
    description: "Find and join student-run organizations on campus",
  },
];

const categories = [
  "academic",
  "financial",
  "career",
  "health",
  "social",
  "student-submitted",
];

function Resources() {
  const [resources, setResources] = useState(initialResources);
  const [activeCategory, setActiveCategory] = useState("academic");
  const [searchTerm, setSearchTerm] = useState("");
  const [showDialog, setShowDialog] = useState(false);
  const [newResource, setNewResource] = useState({
    title: "",
    description: "",
    category: "",
  });

  const filteredResources = resources.filter(
    (resource) =>
      (resource.category === activeCategory ||
        activeCategory === "student-submitted") &&
      (resource.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
        resource.description.toLowerCase().includes(searchTerm.toLowerCase()))
  );

  const handleSubmit = (e) => {
    e.preventDefault();
    setResources([...resources, { ...newResource, id: resources.length + 1 }]);
    setShowDialog(false);
    setNewResource({ title: "", description: "", category: "" });
  };

  return (
    <div className="student-resource-page">
      <main>
        <h1>JumpStart</h1>
        <p className="subtitle">
          Explore our wide range of student resources to support
          <br />
          your academic and personal goals.
        </p>

        <div className="search-container">
          <input
            type="text"
            id="search-input"
            placeholder="Search resources..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <span className="search-icon">🔍</span>
        </div>

        <div className="tabs">
          {categories.map((category) => (
            <button
              key={category}
              className={`tab ${activeCategory === category ? "active" : ""}`}
              onClick={() => setActiveCategory(category)}
            >
              {category.charAt(0).toUpperCase() + category.slice(1)}
            </button>
          ))}
        </div>

        <div className="resources-container">
          {filteredResources.map((resource) => (
            <div key={resource.id} className="resource-card">
              <h3>{resource.title}</h3>
              <p>{resource.description}</p>
              <button className="btn-primary">Learn More</button>
            </div>
          ))}
        </div>

        <button
          id="submit-resource"
          className="btn-primary"
          onClick={() => setShowDialog(true)}
        >
          ➕ Submit a Resource
        </button>
      </main>

      {showDialog && (
        <div className="dialog">
          <div className="dialog-content">
            <h2>Submit a New Resource</h2>
            <p>
              Share a valuable resource with your fellow students. Please
              provide accurate information.
            </p>
            <form onSubmit={handleSubmit}>
              <div>
                <label htmlFor="title">Resource Title</label>
                <input
                  type="text"
                  id="title"
                  required
                  value={newResource.title}
                  onChange={(e) =>
                    setNewResource({ ...newResource, title: e.target.value })
                  }
                />
              </div>
              <div>
                <label htmlFor="description">Description</label>
                <textarea
                  id="description"
                  required
                  value={newResource.description}
                  onChange={(e) =>
                    setNewResource({
                      ...newResource,
                      description: e.target.value,
                    })
                  }
                ></textarea>
              </div>
              <div>
                <label htmlFor="category">Category</label>
                <select
                  id="category"
                  required
                  value={newResource.category}
                  onChange={(e) =>
                    setNewResource({ ...newResource, category: e.target.value })
                  }
                >
                  <option value="">Select a category</option>
                  {categories.slice(0, -1).map((category) => (
                    <option key={category} value={category}>
                      {category.charAt(0).toUpperCase() + category.slice(1)}
                    </option>
                  ))}
                </select>
              </div>
              <button type="submit" className="btn-primary">
                Submit Resource
              </button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
}

export default StudentResourcePage;
